import './Profile.css';
import Header from '../Header/Header';

export default function Orders({ orders }) {

  console.log(orders)
  if (!orders) {
    return <div>Loading...</div>
  }


  return (
    <>
    <Header/>
    <main className='orders'>
      <ul className='orders-list'>
        {orders.map((order) => {
          <li className='order'>
            <h3 className='order__header'></h3>
            
          </li>
        })}
      </ul>
    </main>
    </>
  )
}
